import React, { useState } from "react";

import Breadcrumbs from "../../src/components/Common/Breadcrumb";

import {
  Row,
  Col,
  Card,
  CardBody,
  FormGroup,
  Button,
  CardTitle,
  CardSubtitle,
  Label,
  Input,
  InputGroup,
  CardImg,
  CardText,
  CardHeader,
  CardImgOverlay,
  CardFooter,
  CardDeck,
  CardColumns,
  CardGroup


} from "reactstrap";
import { AvForm, AvField } from "availity-reactstrap-validation";
import { Link } from "react-router-dom"
//import img2 from "../../assets/images/small/img-2.jpg"
import img2 from '../../src/assets/images/small/img-2.jpg';


const ViewDoctor =()=> {
  // States for Input fields...
  // Will be shared to the backend via axios
  const [doctorid,setDoctorid] = useState(null);

  function handleSubmit(e) {
    e.preventDefault();
    if (doctorid != null ){
        console.table(doctorid);
    } else {
        alert("Doctor Id Required.");
    }
   
 
  }


    return (
    <React.Fragment>
    <div className="page-content">
      <Breadcrumbs title="Doctors" breadcrumbItem="View Doctor" />

      <Row>
        <Col xl="8">
          <Card>
            <CardBody>
              <h4 className="card-title"> Doctor Information - Search</h4>
              <p className="card-title-desc">
                Enter the id of the doctor to View the information required.
              </p>

      
              <AvForm className="needs-validation">
                <Row>
                  <Col md="6">
                    <div className="mb-3">
                      <Label htmlFor="validationCustom01">Search</Label>
                      <AvField
                        name="firstname"
                        placeholder="Id.."
                        onChange={(e) => setDoctorid(e.target.value)}
                        type="text"
                        className="form-control"
                        validate={{ required: { value: true } }}
                        id="validationCustom01"
                      />
                    </div>
                    <Button onClick={handleSubmit} color="primary" type="submit">
                    Search
                    </Button>
                  </Col>
                </Row>





              </AvForm>
            </CardBody>
          </Card>
        </Col>
      </Row>


    </div>
  </React.Fragment>
  )
}


export default ViewDoctor;
